import React from 'react';
import Card from '../UI/Card';

import classes from './ShowTinyUrl.module.css'
import Button from "../UI/Button";
import axios from "axios";

const goToLongUrl = (event,result) =>{

    event.preventDefault();

    axios.get(`http://localhost:5000/result`,
        JSON.stringify({longUrl:enteredUrl}),
        {
            headers:{
                "Content-Type":"application/json"
            },
        })
};


const ShowTinyUrl = (props) =>{

    const result = props.result;

    return(
        <form onSubmit={(event)=>goToLongUrl(event,result)}>
            <Card className={classes.result}>
                <div className={classes.detail}>
                    {props.result}
                    <Button
                        type="submit"
                    >
                    Go
                    </Button>
                </div>
            </Card>
        </form>
    )
};

export default ShowTinyUrl;
